-- Table structure for `f_availability`
-- ----------------------------
DROP TABLE IF EXISTS `f_availability`;
CREATE TABLE `f_availability` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `reg_time` int(11) DEFAULT NULL COMMENT '注册时间',
  `create_time` int(11) DEFAULT NULL COMMENT '录入时间',
  `checkin_time` int(11) DEFAULT NULL COMMENT '入住时间',
  `user_id` int(11) DEFAULT NULL COMMENT '关联用户ID',
  `pro_id` int(11) DEFAULT NULL COMMENT '关联省ID',
  `city_id` int(11) DEFAULT NULL COMMENT '关联市ID',
  `area_id` int(11) DEFAULT NULL COMMENT '关联区',
  `stree_id` int(11) DEFAULT NULL COMMENT '关联镇/办事处ID',
  `village_id` int(11) DEFAULT NULL COMMENT '关联村ID',
  `login_time` int(11) DEFAULT NULL COMMENT '登录时间',
  `room_num` int(11) DEFAULT NULL COMMENT '房间号',
  `phone_verify_code_time` int(11) DEFAULT NULL COMMENT '验证码生成时间',
  `rent_id` int(11) DEFAULT NULL COMMENT '关联租金范围ID',
  `call_phone_num` int(11) DEFAULT '0' COMMENT '打电话数',
  `focus_num` int(11) DEFAULT '0' COMMENT '关注数',
  `cancel_focus_num` int(11) DEFAULT '0' COMMENT '取消关注数',
  `browse_num` int(11) DEFAULT '0' COMMENT '浏览数',
  `order_num` int(11) DEFAULT '0' COMMENT '预约数',
  `pic_status` tinyint(4) DEFAULT '1' COMMENT '是否已添加图片：1为未添加，2为已添加',
  `sex` tinyint(4) DEFAULT '3' COMMENT '性别：1为女、2为男、3未知',
  `disable_status` tinyint(4) DEFAULT '1' COMMENT '禁用状态：0为禁用、1为正常、2待审批',
  `house_type_id` tinyint(4) DEFAULT NULL COMMENT '房型：关联房型ID',
  `status` tinyint(4) DEFAULT '0' COMMENT '房源出租状态：0为招租；1为已租',
  `hall` tinyint(4) DEFAULT NULL,
  `month_num` tinyint(4) DEFAULT NULL COMMENT '几月结一次',
  `chaoxiang_id` tinyint(4) DEFAULT NULL COMMENT '朝向：关联朝向ID',
  `deposit_id` tinyint(4) DEFAULT NULL COMMENT '关联押金方式ID',
  `property_type_id` tinyint(4) DEFAULT NULL COMMENT '关联房屋类型ID：如公寓',
  `appointment_status` tinyint(4) DEFAULT '1' COMMENT '预约时间状态：1为未过期，2为已过期',
  `rent` decimal(20,2) DEFAULT '0.00' COMMENT '租金',
  `road` varchar(255) DEFAULT NULL COMMENT '街/路',
  `phone_verify_code` varchar(10) DEFAULT NULL COMMENT '验证码',
  `furniture_config_id` varchar(32) DEFAULT '' COMMENT '关联家具配置ID,ID以逗号隔开',
  `app_config_id` varchar(32) DEFAULT '' COMMENT '关联家电配置表,以逗号分隔关联的id',
  `attach_config_id` varchar(32) DEFAULT '' COMMENT '关联附加配置ID，ID以逗号隔开',
  `client` varchar(255) DEFAULT '微信端' COMMENT '客户端：如微信端',
  `mian_ji` varchar(10) DEFAULT NULL COMMENT '面积',
  `gong_cheng` varchar(10) DEFAULT NULL COMMENT '共几层',
  `ji_cheng` varchar(10) DEFAULT NULL COMMENT '第几层',
  `hao` varchar(10) DEFAULT NULL,
  `xiang` varchar(10) DEFAULT NULL COMMENT '第几巷：例如 11巷',
  `ji_fang` varchar(4) DEFAULT '0' COMMENT '几房',
  `ji_ting` varchar(4) DEFAULT '0' COMMENT '几厅',
  `user_name` varchar(32) DEFAULT '' COMMENT '房东名字',
  `phone` varchar(32) DEFAULT '' COMMENT '房东手机号',
  `tag_number` varchar(32) DEFAULT '' COMMENT '房源编号:市号-区号-街道-跟上ID',
  `credentials_img` varchar(255) DEFAULT NULL COMMENT '证件图路径',
  `houses_img` varchar(1000) DEFAULT NULL COMMENT '房屋图路径',
  `addressed` varchar(255) DEFAULT NULL COMMENT '房源地址',
  `property_title` varchar(255) DEFAULT '' COMMENT '房屋标题',
  `fu_ji` varchar(4) DEFAULT NULL COMMENT '付几',
  `ya_ji` varchar(4) DEFAULT NULL COMMENT '押几',
  `extra_charge` varchar(255) DEFAULT '' COMMENT '额外费用：以||为分隔符',
  `houses_config` varchar(255) DEFAULT '' COMMENT '房屋配置',
  `others` varchar(255) DEFAULT NULL COMMENT '便利设施：其他',
  `metro` varchar(255) DEFAULT NULL COMMENT '便利设施：地铁',
  `bus` varchar(255) DEFAULT NULL COMMENT '便利设施：公交',
  `role` varchar(16) DEFAULT '房东' COMMENT '角色：房东',
  `houses_document_id` varchar(1000) DEFAULT '' COMMENT '房屋描述：关联描述表ID，以||为分隔符拼接文字描述',
  `user_type` varchar(30) DEFAULT '' COMMENT '用户类型：房东',
  `search_save_content` text COMMENT '查找保存的内容',
  `import_user_name` varchar(255) DEFAULT 'landor' COMMENT '导入Excle表的管理员',
  `others_fee` varchar(10) DEFAULT NULL COMMENT '其他费用',
  `dian_fee` varchar(10) DEFAULT NULL COMMENT '电费',
  `shui_fee` varchar(10) DEFAULT NULL COMMENT '水费',
  `weisheng_fee` varchar(10) DEFAULT NULL COMMENT '卫生费',
  `kuandai_fee` varchar(10) DEFAULT NULL COMMENT '宽带费',
  `wuya_fee` varchar(10) DEFAULT NULL COMMENT '物业费',
  `feng_mian_image` varchar(255) DEFAULT '' COMMENT '封面图',
  `remark` text COMMENT '备注',
  `ji_chu` varchar(4) DEFAULT '0' COMMENT ' 几厨',
  `ji_wei` varchar(4) DEFAULT '0' COMMENT '几卫',
  `rent_type` tinyint(4) DEFAULT '1' COMMENT '1,整租；2,合租',
  `top` tinyint(4) unsigned DEFAULT '0' COMMENT '置顶排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1542 DEFAULT CHARSET=utf8 COMMENT='f_availability房源表';

