  `tag_number` varchar(32) DEFAULT '' COMMENT '房源编号:市号-区号-街道-跟上ID',
  `credentials_img` varchar(255) DEFAULT NULL COMMENT '证件图路径',
  `houses_img` varchar(1000) DEFAULT NULL COMMENT '房屋图路径',
  `addressed` varchar(255) DEFAULT NULL COMMENT '房源地址',
  `property_title` varchar(255) DEFAULT '' COMMENT '房屋标题',
  `fu_ji` varchar(4) DEFAULT NULL COMMENT '付几',
  `ya_ji` varchar(4) DEFAULT NULL COMMENT '押几',
  `extra_charge` varchar(255) DEFAULT '' COMMENT '额外费用：以||为分隔符',
  `houses_config` varchar(255) DEFAULT '' COMMENT '房屋配置',
  `others` varchar(255) DEFAULT NULL COMMENT '便利设施：其他',
  `metro` varchar(255) DEFAULT NULL COMMENT '便利设施：地铁',
  `bus` varchar(255) DEFAULT NULL COMMENT '便利设施：公交',
  `role` varchar(16) DEFAULT '租客' COMMENT '角色：租客',
  `houses_document_id` varchar(1000) DEFAULT '' COMMENT '房屋描述：关联描述表ID，以||为分隔符拼接文字描述',
  `user_type` varchar(30) DEFAULT '' COMMENT '用户类型：租客',
  `search_save_content` varchar(1000) DEFAULT NULL COMMENT '搜索内容',
  `import_user_name` varchar(255) DEFAULT 'landor' COMMENT '导入Excle表的管理员',
  `others_fee` varchar(10) DEFAULT NULL COMMENT '其他费用',
  `dian_fee` varchar(10) DEFAULT NULL COMMENT '电费',
  `shui_fee` varchar(10) DEFAULT NULL COMMENT '水费',
  `weisheng_fee` varchar(10) DEFAULT NULL COMMENT '卫生费',
  `kuandai_fee` varchar(10) DEFAULT NULL COMMENT '宽带费',
  `wuya_fee` varchar(10) DEFAULT NULL COMMENT '物业费',
  `feng_mian_image` varchar(255) DEFAULT '' COMMENT '封面图',
  `remark` text COMMENT '备注',
  `ji_chu` varchar(4) DEFAULT '1' COMMENT ' 几厨',
  `ji_wei` varchar(4) DEFAULT '1' COMMENT '几卫',
  `share_type` tinyint(4) DEFAULT '0' COMMENT '合租类型：1有房;0无房',
  `share_detail` varchar(1000) DEFAULT '' COMMENT '合租详情',
  `weixin_id` varchar(100) DEFAULT '' COMMENT '微信号',
  `callable` tinyint(4) DEFAULT '0' COMMENT '是否可以在网页上面，直接电话联系：1可以，0默认不可以',
  `business_id` int(4) DEFAULT NULL COMMENT '商圈ID',
  `metro_id` int(4) DEFAULT NULL COMMENT '地铁线路ID',
  `station_id` int(4) DEFAULT NULL COMMENT '地铁站ID',
  `address_near` varchar(100) DEFAULT '' COMMENT '租客想住的地址',
  `gender_type` tinyint(4) DEFAULT NULL COMMENT '1男2女',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1504 DEFAULT CHARSET=utf8 COMMENT='f_availability房源表';

